import React from 'react';
import Employeedropdown from './Employeedropdown';
function Updateprogress(props) {
    return (
        <div>
             <Employeedropdown></Employeedropdown>
            update progress
            <div className="container">
                <div className="row">
                    <div className="col-md-4 offset-md-4 border rounded  mt-2 shadow">
                        <h2 className="text-center m-4">Admin Login</h2>
                        <form onSubmit={(e) => handleSubmit(e)}>
                            <div className="mb-3">

                                <label htmlFor="UserName" className="form-label">UserName</label>
                                <input
                                    type={"text"}
                                    className="form-control"
                                    placeholder="Enter your UserName"
                                    name="username"
                                    value={username}
                                    onChange={adminhandler}
                                ></input>
                            </div>
                           
                            <button type="submit" className="btn btn-info  m-4">Login</button>
                            <br></br>
                        </form>
                    </div>

                </div>
            </div>
        </div>
    );
}

export default Updateprogress;
